import React from 'react';
import ReactDOM from 'react-dom';
import './style.sass';
import openSocket from 'socket.io-client';


class Camera extends React.Component {
  render() {
    return (
      <div>
        <img src={this.props.img} alt="ROV camera output"/>
      </div>
    );
  }
}

// ========================================

ReactDOM.render(
  <Camera img={() => { getData() }}/>,
  document.getElementById('root')
);

// const io = openSocket('http://localhost:3000');
function getData() {
  let imgData;
  // io.on('send img data', data => {
  //   imgData = data;
  // })
  fetch('./klateczka.txt', {mode: 'no-cors'})
    .then(data => {
      console.log(data.text());
    });
  // console.log(imgData);
  return imgData;
}
